import React from 'react';
import { Navbar3 } from '../../../../components';
import { useNavigate } from "react-router-dom";
import { useState, useRef } from "react";
import './passwordResult.css';

const PasswordResult = () => {

    const navigate = useNavigate();
    // Ref for focus element:
    const passwordRef = useRef(null);
    const [userInput, setUserInput] = useState({password: '', confirmPassword: ''})

    async function handleFormSubmit(e) {
        e.preventDefault();

        try {
          // TODO: confirmPassword method in AuthContext
          navigate("/login");
        }
        catch (e) {
          console.log(e);
        }
    }

  return (
    <div>
    <Navbar3/>
    <div className='login'>
    <h1>Reset Password</h1>
      <div className='auth__result'>
        <form className='signup__fields' onSubmit={handleFormSubmit}>
            <input
            className='signup__input'
            required
            placeholder="Email"
            autoComplete='email'
            name='email'
            autoFocus
            ref={passwordRef}
            onChange={(e) => setUserInput({...userInput, password: e.target.value})}
            />
            <input
            className='signup__input'
            required
            type='password'
            autoComplete='new-password'
            placeholder="Password"
            onChange={(e) => setUserInput({...userInput, confirmPassword: e.target.value})}
            />
            <button type="submit" className='signup__button'>
                {buttonText}
            </button>
        </form>
      </div>
    </div>
</div>
  )
}

export default PasswordResult
